// This is a subcomponent of the gallery.
import Layer from "./Layer";
import floraData from "../../data/floraData"

const FloraFaunaFungi = () => {
  return (
    <div className="flex-row pt-2 pb-5"> 
        <Layer 
            heading="Flora"
        />
        <Layer 
            heading="Fauna"
        />
        <Layer 
            heading="Fungi"
        />
    </div>
  );
};
export default FloraFaunaFungi;
